;var mess=["Ich bin auf einer Raumstation gefangen und habe es anscheinend endlich geschafft Kontakt zu jemandem auf Erde aufzunehmen. Arbeitest du bei der NASA?","Okay, sehr gut. Du musst mir helfen. ISRO, die Organisation, die mich hier rauf geschickt hat wurde soeben von Hackern angegriffen. Ihr ganzes Netzwerk ist ausgefallen.","Schade.... Wer bist du?","Nein. Hier scheint gar nichts mehr zu funktionieren. Im Moment habe ich noch 36% 0² in meinem Raumanzug.. In dem Raum, indem ich mich befinde gibt es keine Atemluft. Es scheint als hätten die Hacker die Luft abgelasen. Und dieser unkontrollierte Luftstoß hat die Raumstation vom Kurs abgebracht..","Ich weiß es nicht. Ich habe jetzt nicht genug Zeit um mich woanders hin zu verbinden. Du musst mir helfen. Bitte!","Webdeveloper oder was? Vielleicht kannst du mir wirklich helfen..  Weißt du wie ich einen Computer über das BIOS resetten kann? Dann könnte ich vielleicht so die Luftschleuse nach draußen öffnen..","Es gibt eine Schleuse, aber da die Elektronik ausgefallen ist, habe ich keinen Motor der diese öffnet","Nicht viel. Es gibt einen TORX-6 Schraubenzieher, einen Staubsauger und einen RXTv420.","Bitte! Es geht um Leben und Tod!","Ich bräuchte irgendwelche Hilfsmittel.","Ja.. Bis auf die Panzerglas-Scheibe..","Das wird schwierig. Ich habe schon die letzten Reserven bei mir.","Verdammt. Egal, du musst mir helfen","Moment.. Ich glaube es funktioniert! Haha! JA, ich habe Kontrolle über die Luftschleuse! Soll ich gleich raus? Ich hab nicht mehr viel Sauerstoff..","","Ja, ich glaube das sollte funktionieren. Das Signal meines Notfall-Handy's läuft über den Astra-Sattelit. Damit hat man hier auch bei schlechtem Wetter immer Empfang..","Es ist so still.. Und die restliche Luft in meinem Raumanzug riecht nach Metall.. Aber wahnsinnig schön hier oben..","#nofilter","Zum Zentral-PC, der ist nicht weit von hier.","Achso ja, das hätte ich vielleicht erwähnen sollen.","","Das ist ein bisschen kompliziert. Ich wurde hier von der ISRO (Indische Raumfahrtorganisation) her gebracht.. Es ist eigentlich Top Secret, aber ich glaube in meiner aktuellen Situation sollte ich vielleicht alle Infos mit dir Teilen.. Zwei Köpfe sind besser als einer. Also.. kurz gesagt: Der erste Kontakt steht bevor. Indische Wissenschaftler haben es geschafft mit einem Strahlenbeschleuniger Kontakt mit Etwas aufzunehmen. Es oder Sie sind seit mehreren Jahren auf den Weg hier her. Sie kommen aus 'Cosmos Redshift 7'. Ich glaube den paranoiden Anführeren unserer Welt war es sehr wichtig eine friedliche Begegnung zu ermöglichen. Darum bin ich hier. ","Wir konnten ihre Ankunft nur auf ein Zeitfenster von 4 Tagen berechnen. Sie könnten jeden Moment ankommen, und hier läuft gerade alles schief..","Darüber hab ich noch nicht nachgedacht.. Du meinst die Aliens könnten hier alles lahm gelegt haben?","","Hilfe, mein Raumanzug hat ein Loch!","Ich bewege mich gerade langsam die Außenhülle der Raumstation entlang. Ich muss extrem aufpassen nicht den Halt zu verlieren.. Ich müsste gleich bei der nächsten Raumschleuse sein.. Warte mal kurz! Leise!","Ok, bin wieder da. Da war gerade irgend was. Es war glänzend Schwarz.","Verdammt, sie haben mich gehörlkjhvcx","Okay ich bin drin.. Oh.. Verdammt.. Hier ist alle voller Gedärme.. Schaut so aus als hätte er seinen Raumanzug nicht schnell genug angezogen..","Verdammt, mein Anzug brennt!!!","So makaber es ist.. Ja. Ich nehme mir seine Sauerstofftanks."," ","Glaubst du dass kann ich jetzt an den Gedärmen erkennen?"," ","Meine Sauerstoff-Reserven sind jetzt zumindest wieder bei 42%. Ich glaub ich kann von hier aus zur Haupt-Schleuse laufen. Dort war die erste Begegnung geplant, wenn nicht alles ausgefallen wäre. Soll ich weiter oder mich lieber noch ein bisschen Umschauen?","Okay.. Hier scheint eine Art Satellit in die Außenwand eingebaut zu sein.. Zwei orange Knöpfe leuchten noch. Es scheint russisch zu sein.. Hier steht 'Прямой эфир' und 'ад'. Was soll ich drücken?","Ok. Ich bin mir nicht sicher ob das jetzt etwas ausgelöst hat. Aber jetzt leuchten keine Knöpfe mehr. Was jetzt? Hier gibt es eine Luke, zum 'Punkt der ersten Begegnung' oder zum 'Maschinenraum'?","Hm. Hier ist es ziemlich dunkel. Ich höre aber noch ein leises Surren. Hier ist es feucht.. Moment.. Wasser? Das ist nicht gut!","Oh nein.. Ich glaube das ist nicht gut...  hier steht 'Ад наступит'....   'ад' bedeutet Hölle!","OK, hör mal, ich bin gerade jemandem begegnet. Sein name ist 'Kek'. Er spricht Englisch mit Arabischem Akzent. Ich hätte nicht erwartet hier noch jemandem zu Begegnen. Er sieht aus, als ob er schon sehr lange in der Schwerelosigkeit lebt. Trotzdem ist er ganz klar ein Mensch. Und hier kommt das Merkwürdige: Er gibt sich als Botschafter des المملكة المصرية aus. Er sagt er sei Teil eines Todes-Heimats-Komandos. Er hat mir stichhaltig anhand von wissenschaftlichen Fakten erklärt, dass die alten Ägypter die Erde schon vor tausenden von Jahren aufgrund einer Diktator-AI verlassen hatten. Sie haben für mehr als 3.000 Jahre in der 'Cosmos Redshift 7' Galaxie gelebt, und dort eine 3 Klassen Gesellschaft mit vielen Pyramiden etabliert. Seitdem Abtreibung bestraft wird leiden alle bewohnbaren Planeten an Überbevölkerung, und nun sei es Zeit, wieder nach Hause zu kommen. Einen homo-sapiens vernichtenden Todestrahl haben sie auch dabei. Und jetzt?"," ","Er sagt: Dieser Planet ist nicht groß genug für uns beide.","Die  المملكة المصرية können nicht nachvollziehen was wir auf der Erde veranstaltet haben, seit sie Weg sind. Besonders die Deutschen und Amerikaner hätten sich Fehlverhalten. Er bietet an nur Amerikaner und Deutsche zu töten.","Kek sagt, dass das was sie die  المملكة المصرية am meisten aufregt, die hässliche Architektur von uns sei. Besonders alle vertikalen parallelen seien eine Schande. Ich weiß nicht genau was er meint.","Ich glaube das hat einen interplanetaren Krieg ausgelöst...","Ich glaube sie haben zuerst auf Dresden gezielt.. Tut mir leid.","Die Idee findet 'Kek' ganz gut. Ich soll ihm in einen anderen Raum foglen.","Hier hat ein riesiges schwarzes Tarnschiff angedockt! Sie waren schon die ganze Zeit über hier, und haben mich getestet.","Kek insistiert.","Da hast du Recht. Ägypter passen Design-Mäßig einfach gut in den Weltraum. Vor mir sitzt 'Snofru' der Pharao! Er sollte seit 4.500 Jahren Tod sein.. Verrückt oder? ","Das fand er nicht so lustig.. "," "],ans=["Ja","Nein","Aber das Netzwerk bei dir auf der Station funktioniert noch?","Ähm, in Wirklichkeit bin ich gar nicht bei der NASA.","Ich bin nur ein random Dude. Wie kommt es, dass du deine Nachrichten ausgerechnet bei mir ankommen?","Ich bin zwar nur ein random Dude, aber ich kenne mich ganz gut mit Technik aus.","Gibt es einen Weg nach Draußen?","Was siehst du um dich? Könntest du irgendetwas basteln?","Wie kann ich helfen?","Ehrlich gesagt wollte ich jetzt gerade Feierabend machen...","Guckmal nach Sauerstoff!","Versuch mal den PC zu starten und drück F13 beim booten. Sollte NASA-Standart sein.","Kannst du sie manuell öffnen?","Ist das der einzige Weg nach draußen?","Ehrlich gesagt arbeite ich gar nicht bei der NASA. Ich weiß nicht, was diese begriffe bedeuten.","Versuch es mal mit dem RTXv420.","Na gut, wie ist die Lage?","Nein ernsthaft, ich habe Feierabend. Lass dir von wem anderen helfen. Es ist schon nach "+hours+" Uhr!","Hast du in deinem Raum irgendwas, was dir helfen könnte?"," ","Bekommst du die auf?","Verdammt, Ich weiß auch nicht..","Okay. Dann musst du aus diesem Raum. Kommst du irgendwie anders raus?"," ","Kann ich nicht, tut mir leid.","Kommst du irgendwie noch an Sauerstoff?","ja!","Kannst du da draußen auch mit mir Kommunizieren?","","","OK. Dann schau dich mal draußen um.","Du hast ein Handy? Warum schickst du mir kein Foto?","Du verarscht mich doch? Ich denke du stirbst gerade?","Wohin musst du jetzt?","Oh mein Gott... Bist du Gandi??","Wirklich schön dort oben. Okay, ich vertraue dir, aber weiter jetzt!","Dann los! Was machst du eigentlich im Weltall?","","Was machst du denn im Weltraum?","Lit 🔥","","","Ach du scheiße! Ich wusste es! Und wann kommen sie an?","","Sicher, dass die Hacker von der Erde stammen?","Das heißt sie könnten jeden Moment ankommen! Weiter, der erste Eindruck zählt!","Ich glaube wir sind verloren..","Denk nicht drüber nach. Siehst du schon irgend etwas? Wo bist du gerade?"," "," "," "," ","...","Was ist da??","Geh wieder in die Raumstation, beeil dich!","Was war das??","","","Siehst du den Raumanzug? Ist dort noch Sauerstoff?","Oh mein Gott. Tut mir leid.. Einfach weiter!","","","Kanntest du ihn?","Hast du wieder genug Sauerstoff?","","","Anscheinend kanntest du ihn nur äußerlich.. ","Tut mir leid.","","","Umschauen.","Nein, lieber schnell weiter.","любовь","ад","Durch die Luke!","Zum Maschinenraum!","Verdammt, es steht unter Strom!","","","","Wir kämpfen!","Frag ihn nach einer anderen Lösung.","","","Aber wir sind doch alle Menschen! One Love? :(","Gibt es keinen Kompromiss?","Das finde ich nicht so gut, da ich Deutscher bin..","","Sag ihm wir zwingen sie. Wenn sie nicht Kooperieren zerstören wir die Pyramiden!","Wir organisieren staatliche Fördergelder für die Stein-Industrie und wechseln mal die Tapete.","Verdammt","","Verdammt","","OK.","NOOOOIN GEEH NIICHT","Verdammt, das ist gemein. Sie haben Leute getötet!","War doch vorherzusehen der Plot-Twist.","OK","","Brains...","Na dann setzt ihr beide jetzt mal schön nen Völker-Vertrag auf.","Verdammt","","ende",""];run();
